import { Container, Row, Col } from 'mdbreact';
import React, { Component }  from 'react';
import Carousel, { consts } from 'react-elastic-carousel';
import SlideComponent from '../components/js/SlideComponent';
import ZaloComponent from '../components/js/ZaloComponent';
import QuantityIncrementButton from '../components/js/QuantityIncrementButton';
import { MDBCard, MDBCardImage, MDBCardText, MDBCardBody } from 'mdbreact';
import { MDBRow, MDBCol, MDBContainer } from 'mdbreact';
import { MDBRipple } from 'mdb-react-ui-kit';
import CarouselPage from '../components/js/TestModule';
import ReactSlider from 'react-slider';
const PhuKienPhongTam = () => {
    return (
      <div>
        <ZaloComponent/>

        <div class="d-flex justify-content-center mb-5" style={{height : "60vh"}}>
            <div className='col-lg-10'>
                <div className='d-flex justify-content-center mb-5'>
                    <form className='col-lg-2 text-dark bg-light mr-5'>
                        <div>Filter</div>
                        <div>Khoảng giá</div>
                        <div>
    <label id="first-slider-label">Start slider label</label>
    <label id="second-slider-label">End slider label</label>
    <ReactSlider
        className="horizontal-slider"
        thumbClassName="example-thumb"
        trackClassName="example-track"
        defaultValue={[0, 100]}
        ariaLabelledby={['first-slider-label', 'second-slider-label']}
        ariaValuetext={state => `Thumb value ${state.valueNow}`}
        renderThumb={(props, state) => <div {...props}>{state.valueNow}</div>}
        pearling
        minDistance={10}
    />
</div>
                        <br></br>
                        <button type='submit'>Lọc</button>
                        <div className='col-lg-10'></div>
                    </form>
                    <div className='col-lg-10 text-dark bg-secondary'>
                        <div className='text-center '>DANH SÁCH SẢN PHẨM</div>
                        <div></div>
                    </div>
                </div>
                           
            </div>
          
        </div>

        
        
      </div>
    );
    
  };
  
  export default PhuKienPhongTam;
